import React, { Component } from 'react';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      data: [],
      checked:false
    }
  }

  // handleCheck(event) {
  //   const value = event.target.value;
  //   console.log(value)
  // }

  componentDidMount() {
    this.setState({ data: [
      { name: 'raju', age: 35}, 
      { name: 'ramu', age: 30 },
       { name: 'ravan', age: 23 },
        { name: 'laxman', age: 18 }] })
  }

  render() {


    console.log(this.state.data)

    return (
      <div>
        <ul>
          {this.state.data.map(item => {
            return <li>{item.name}-{item.age}</li>;
          })}
        </ul>
        Yes:<input type="checkbox" defaultChecked={this.state.data.filter((data)=>{ console.log(data.age>18)})}  />      
      </div>
    );
  }
}

export default App;
